import '../../App.css';
import pagePadding from "./pages.css"
import CrimeByDay from '../CrimeByDay';
import CrimeTimesRanked from '../CrimeTimesRanked';

function SFTourism() {
    return (
        <>
            <CrimeByDay />
            <CrimeTimesRanked />
        </>
    );
}

export default SFTourism;
